import { useState } from 'react';
import React from 'react'; 

function CustomerEntryForm (){
    const [name, setName] = useState("");
    return (
        <form>
            <label> Enter Your Name:
                <input
                    type = "text"
                    value = {name}
                    onChange = {(e) => setName(e.target.value)}
                />
            </label>
        </form>
    )
}

export default customerEntryForm;
